import styled from 'styled-components';

const OnePage = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;
    width: 100%;
    height: 100%;
    z-index: 0;
    position: relative;
`;

export default OnePage;
